<!DOCTYPE html>
<html lang="en">
	<head>
		<meta charset="UTF-8">
		<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
		<title>Portfolio page</title>
		<style>
			
			#menuContainer {
				width: 50px;
				height: 100%;
				position: fixed;
				top: 0;
				left: 0;
				background-color: #1E364B;
				z-index: 99999;
				transition: 0.5s cubic-bezier(0, 0.5, 0.5, 1);
				filter: url('#shadowed-goo');
			}
			#menuContainer:hover{
				width: 250px;
			}
			#menuBtn{
				width: 40px;
				height: 40px;
				background-color: #1E364B;
				position: relative;
				top: 50%;
				right: -80%;
				border-radius: 100%;
				display: flex;
				justify-content: center;
				align-items: center;
				flex-direction: column;
				transition: 0.5s cubic-bezier(0, 0.5, 0.5, 1);
				transition-delay: 0s;
			}
			#menuBtn div{
				width: 15px;
				height: 0px;
				border: 1px solid beige;
				margin: 3px;
				position: relative;

			}			
			#menuContainer:hover #menuBtn{
				right: -200px;
				transition-delay: 0.2s;
				background-color: beige;
				color: #1E364B;
			}
			#menuContainer:hover #menuBtn div{
				position: absolute;
				border-color: #1E364B;
				margin: 0;
			}
			#menuContainer:hover #menuBtn div#hamburgerPart1{
				transform: rotate(45deg);
			}
			#menuContainer:hover #menuBtn div#hamburgerPart2{
				display: none;
			}
			#menuContainer:hover #menuBtn div#hamburgerPart3{				
				transform: rotate(-45deg);
			}

		</style>
	</head>
